function guid() {
    function s4() {
        return Math.floor((1 + Math.random()) * 0x10000)
          .toString(16)
          .substring(1);
    }
    return s4() + s4() + s4() + s4() +
      s4() + s4() + s4() + s4();
}
if (typeof String.prototype.endsWith !== 'function') {
    String.prototype.endsWith = function (suffix) {
        return this.indexOf(suffix, this.length - suffix.length) !== -1;
    };
}
//OPEN FILE DIALOG LIB
var OpenFileDialog = (function () {

    function OpenFileDialog(filter) {
        var id = guid();
        $('body').append('<input style="position: absolute; z-index: -100; top: -100px;" type="file" name="UploadFile" id="' + id + '" />');
        this.did = id;
    }
    OpenFileDialog.prototype.Show = function (callback) {
        $('#' + this.did).trigger('click');
        $('#' + this.did).on('change', function (e) {
            callback();
        });
    };
    OpenFileDialog.prototype.SetFilter = function (filter) {
        this.dfilter = filter;
        $('#' + this.did).attr("accept", filter);
    };
    OpenFileDialog.prototype.GetFile = function () {
        input = document.getElementById(this.did);
        return input.files[0];
    };
    OpenFileDialog.prototype.GetDataBase64 = function (callback) {
        var FR = new FileReader();
        FR.onload = function (e) {
            callback(e.target.result);
        };
        FR.readAsDataURL(this.GetFile());
    };
    OpenFileDialog.prototype.GetDataBinary = function (callback) {
        var FR = new FileReader();
        FR.onload = function (e) {
            callback(e.target.result);
        };
        FR.readAsBinaryString(this.GetFile());
    };
    OpenFileDialog.prototype.GetFileName = function () {
        return $('#' + this.did).val();
    };
    OpenFileDialog.prototype.Dispose = function () {
        $('#' + this.did).remove();
    };
    return OpenFileDialog;
})();



function blurScreen() {
    $("#scrollbox").css("-webkit-filter", "blur(3px)");
    $("#scrollbox").css("-o-filter", "blur(4px)");
    $("#scrollbox").css("filter", "blur(3px)");

    $("#header").css("-webkit-filter", "blur(3px)");
    $("#header").css("-o-filter", "blur(4px)");
    $("#header").css("filter", "blur(3px)");

    $("#footer").css("-webkit-filter", "blur(3px)");
    $("#footer").css("-o-filter", "blur(4px)");
    $("#footer").css("filter", "blur(3px)");
    if (!(/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent))) {
        var elem = document.getElementById("bgvid");
        if (elem != null)
            elem.pause();
    }
    $("#bgvid").css("display", "none");
    $("#bg").css("-webkit-filter", "blur(3px)");
    $("#bg").css("-o-filter", "blur(4px)");
    $("#bg").css("filter", "blur(3px)");

}
function unblurScreen() {
    $("#scrollbox").css("-webkit-filter", "unset");
    $("#scrollbox").css("-o-filter", "unset");
    $("#scrollbox").css("filter", "unset");

    $("#header").css("-webkit-filter", "unset");
    $("#header").css("-o-filter", "unset");
    $("#header").css("filter", "unset");

    $("#footer").css("-webkit-filter", "unset");
    $("#footer").css("-o-filter", "unset");
    $("#footer").css("filter", "unset");

    $("#bg").css("-webkit-filter", "unset");
    $("#bg").css("-o-filter", "unset");
    $("#bg").css("filter", "unset");
    $("#bgvid").css("display", "block");
    if (!(/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent))) {
        var elem = document.getElementById("bgvid");
        if (elem != null)
            elem.play();
    }
}
function blurElement(elname, radius) {
    if (isChrome)
        $("#" + elname).css("-webkit-filter", "blur(" + radius + "px)");
    else if (isOpera)
        $("#" + elname).css("-o-filter", "blur(" + radius + 1 + "px)");
    else
        $("#" + elname).css("filter", "blur(" + radius + "px)");
}
function unblurElement(elname) {
    if (isChrome)
        $("#" + elname).css("-webkit-filter", "unset");
    else if (isOpera)
        $("#" + elname).css("-o-filter", "unset");
    else
        $("#" + elname).css("filter", "unset");
}
 
function redirect(url) {
  
        parent.location.href = url; 
}
